import React from "react";

function ContactMe() {
  function contactBox(site, fab, link) {
    return (
      <a href={link} target="_blank" rel="noopener noreferrer">
        <div className="contactBox">
          <i class={fab}></i>
          <p>{site}</p>
        </div>
      </a>
    );
  }
  return (
    <div>
      <h1>Contact Me</h1>
      {contactBox("Email", "", "mailto:jhartmann26@icloud.com")}
      {contactBox(
        "GitHub",
        "fab fa-github-square size: 5x",
        "https://github.com/johnhartmann26"
      )}
      {contactBox(
        "LinkedIn",
        "fab fa-linkedin",
        "https://www.linkedin.com/in/john-hartmann-a64794159/"
      )}
    </div>
  );
}

export default ContactMe;
